import React, { Component } from 'react';

class ErrorBoundary extends Component {
    constructor(props) {
        super(props);

        this.state = {
            hasError: false
        };
    }

    static getDerivedStateFromError(error) {
        return;
    }

    render() {
        return (
            <div>ErrorBoundary</div>
        )
    }
}

export default ErrorBoundary
